import React from "react";
import Logo from "../Logo";
import "./HeaderLogin.css";

function HeaderLogin(props) {
  const { logoProps } = props;

  return (
    <div className="header-login screen ">
      <div className="rectangle-63"></div>
      <Logo
        group={logoProps.group}
        vector={logoProps.vector}
        vector2={logoProps.vector2}
        vector3={logoProps.vector3}
        vector4={logoProps.vector4}
        vector5={logoProps.vector5}
      />
    </div>
  );
}

export default HeaderLogin;
